import{_ as n,c as a,I as r,w as o,ak as s,D as l,o as A,l as e,a as t}from"./chunks/framework.CrObIqqD.js";const d="data:image/png;base64,",p="/k-centipede/assets/Russie.Bsng8aQb.jpg",u="data:image/png;base64,",c="/k-centipede/assets/Chine.BQN8ynmt.png",S=JSON.parse(`{"title":"GNSS, RTK  et Centipède : Un peu d'histoire...","description":"","frontmatter":{"sidebarDepth":3},"headers":[],"relativePath":"01_apropos/histoire.md","filePath":"01_apropos/histoire.md"}`),h={name:"01_apropos/histoire.md"},m=s('<h1 id="gnss-rtk-et-centipede-un-peu-d-histoire" tabindex="-1">GNSS, RTK et Centipède : Un peu d&#39;histoire... <a class="header-anchor" href="#gnss-rtk-et-centipede-un-peu-d-histoire" aria-label="Permalink to &quot;GNSS, RTK  et Centipède : Un peu d&#39;histoire...&quot;">​</a></h1><h2 id="definition" tabindex="-1">Définition <a class="header-anchor" href="#definition" aria-label="Permalink to &quot;Définition&quot;">​</a></h2><blockquote><p>“La Cinématique temps réel (Real Time Kinematic, en anglais ou RTK) est une technique de positionnement par satellite basée sur l&#39;utilisation de mesures de la phase des ondes porteuses des signaux émis par les systèmes GPS, GLONASS ou Galileo. Une station de référence fournit des corrections en temps réel permettant d&#39;atteindre une précision de l&#39;ordre du centimètre” (<a href="https://fr.wikipedia.org/wiki/Cin%C3%A9matique_temps_r%C3%A9el" target="_blank" rel="noreferrer">Wikipédia, 2023</a>).</p></blockquote><p>La Cinématique temps réel est donc une technologie de positionnement de précision, dont les potentielles utilisations se multiplient avec l’avènement de la robotique. Aujourd’hui, ses principaux domaines d’action sont :</p><ul><li>La construction</li><li>L’agriculture de précision (gestion des agroéquipements connectés). Près de 60% des utilisateurs se servent du réseau Centipède RTK à des fins agricoles.</li><li>Les relevés de terrain (topographie, etc.)</li></ul><p>A l’avenir, la précision centimétrique proposée par la technologie RTK sera certainement convoitée par d’autres domaines professionnels, notamment l’aéronautique et l’automobile.</p><h2 id="rtk-et-gnss" tabindex="-1">RTK et GNSS <a class="header-anchor" href="#rtk-et-gnss" aria-label="Permalink to &quot;RTK et GNSS&quot;">​</a></h2><p>La technologie RTK repose sur le GNSS (<em>Global Navigation Satellite System</em>), qui regroupe l&#39;ensemble des composants utiles au positionnement par satellites.</p><p>Le réseau RTK français repose sur 4 systèmes de navigation internationaux.</p>',9),g=e("table",null,[e("thead",null,[e("tr",null,[e("th",{style:{"text-align":"center"}},"Système de navigation"),e("th",{style:{"text-align":"center"}},"Pays"),e("th",{style:{"text-align":"center"}},"Mise en service")])]),e("tbody",null,[e("tr",null,[e("td",{style:{"text-align":"center"}},[t("GPS ("),e("em",null,"Global Positioning System"),t(")")]),e("td",{style:{"text-align":"center"}},[e("img",{src:d,height:"12",alt:"USA"})]),e("td",{style:{"text-align":"center"}},"1995")]),e("tr",null,[e("td",{style:{"text-align":"center"}},"GLONASS"),e("td",{style:{"text-align":"center"}},[e("img",{src:p,height:"15",alt:"Russie"})]),e("td",{style:{"text-align":"center"}},"1996, puis 2010")]),e("tr",null,[e("td",{style:{"text-align":"center"}},"Galileo"),e("td",{style:{"text-align":"center"}},[e("img",{src:u,height:"15",alt:"Europe"})]),e("td",{style:{"text-align":"center"}},"2016")]),e("tr",null,[e("td",{style:{"text-align":"center"}},"Beidou"),e("td",{style:{"text-align":"center"}},[e("img",{src:c,height:"15",alt:"Chine"})]),e("td",{style:{"text-align":"center"}},"2020")])])],-1),R=s('<h2 id="les-debuts-de-rtk" tabindex="-1">Les débuts de RTK <a class="header-anchor" href="#les-debuts-de-rtk" aria-label="Permalink to &quot;Les débuts de RTK&quot;">​</a></h2><p>La technologie RTK fait ses premiers pas sur des engins agricoles aux Etats-Unis dans les années 2000.</p><p>Ce n&#39;est qu&#39;en 2014 que le RTK fait son apparition en France, par l&#39;intermédiaire d&#39;entreprises privées comme Terria ou Orphéon. Ils proposent à leurs clients leur service de traitement de données menant à la précision centimétrique. Il faut alors compter 500 à 1000€/an d’abonnement par appareil de réception, sans compter les frais d’installation.</p><p>A ses débuts, la technologie RTK représente un investissement important.</p><h2 id="le-projet-centipede" tabindex="-1">Le projet Centipède <a class="header-anchor" href="#le-projet-centipede" aria-label="Permalink to &quot;Le projet Centipède&quot;">​</a></h2><blockquote><p>“Centipède RTK est un réseau collaboratif de bases GNSS ouvertes et disponibles pour toute personne se trouvant dans la zone de couverture. Le réseau est étendu par des instituts publics, des particuliers, des acteurs privés comme les agriculteurs ou d’autres partenaires publics.” (<a href="https://docs.centipede.fr/" target="_blank" rel="noreferrer">INRAE, 2023</a>).</p></blockquote><p>Lancé en 2019 par Julien ANCELIN, chercheur à l&#39;INRAE, l’objectif du projet Centipède RTK est de rendre accessible à tous la technologie RTK. L&#39;INRAE et ses partenaires du projet ont alors développé :</p><ul><li>Des kits d’installation de bases RTK (400 à 500€);</li><li>Une documentation pour comprendre et utiliser le réseau RTK sur ses appareils;</li><li>Un serveur public de collecte et de transmission des données géographiques des bases RTK.</li></ul><p>Tous ces outils sont <strong>open-source</strong>. Ils sont la clé du succès du projet Centipède RTK.</p>',9);function Q(x,b,q,C,T,E){const i=l("center");return A(),a("div",null,[m,r(i,null,{default:o(()=>[g]),_:1}),R])}const w=n(h,[["render",Q]]);export{S as __pageData,w as default};
